import React from 'react'
import { Pressable, View, Text, StyleSheet, Image } from 'react-native';

class CardSalleDetail extends React.Component{
	render(){
		const { detailSalle } = this.props; 
		return(
			<View style={styles.conteneur} >
				<Text>Detail de cette salle avec id : {detailSalle.id}</Text>
			</View>
		)
	}
}

const styles = StyleSheet.create({
	conteneur: {
		marginHorizontal: 20,
		marginVertical: 30,
		backgroundColor:  '#709CA7',
		height: 200,
		width : '100%'

	}
})

export default CardSalleDetail;
